import React from "react";

function Url(props) {
  const domain = props.url && new URL(props.url).hostname;
  return (
    <span >
      &nbsp;(
      <a
        href={props.url}
        className="inline-block text-[75%] text-grey-n hover:underline"
      >
        {domain}
      </a>
      )
    </span>
  );
}

export default Url;
